import styled from "styled-components";
import { motion } from "framer-motion";

const ContactUsComponentStyle = styled(motion.div)`
  margin-top: 150px;
  background-color: #f2c14e;
  width: calc(100% - 80px);
  height: auto;
  padding: 40px;
  display: flex;
  flex-direction: column;
`;

const Expolore = `Explore Design features Prototyping Design systems Pricing Customers Security Integrations Contact`;

const ContactUsComponent = () => {
  return (
    <ContactUsComponentStyle>
      <div className="section1"></div>
      <div className="section2">
        {Expolore.split(" ").map((e, i) => {
          return <span className={(i = 0 ? "title" : "elmnt")}> {e}</span>;
        })}
      </div>
    </ContactUsComponentStyle>
  );
};

export default ContactUsComponent;
